import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { DndProvider, useDrag, useDrop } from "react-dnd";
import { HTML5Backend } from "react-dnd-html5-backend";

const fieldTypes = [
  { type: "text", label: "Text Input" },
  { type: "textarea", label: "Text Area" },
  { type: "number", label: "Number Input" },
  { type: "select", label: "Dropdown" },
  { type: "radio", label: "Radio Buttons" },
  { type: "checkbox", label: "Checkboxes" },
  { type: "date", label: "Date Picker" },
  { type: "file", label: "File Upload" },
];

const DraggableField = ({ field }) => {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "FIELD",
    item: field,
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));

  return (
    <div ref={drag} className="p-2 border bg-light mb-2 w-75" style={{ opacity: isDragging ? 0.5 : 1 }}>
      {field.label}
    </div>
  );
};

const Forms = () => {
  const [fields, setFields] = useState([]);

  return (
    <DndProvider backend={HTML5Backend}>
      <div className="container mt-3">
        <div className="row">
          <div className="col-md-3">
            <h4 className="fw-bolder text-center mb-3">Form Fields</h4>
            <span className="justify-content-center d-flex flex-wrap">
            {fieldTypes.map((field, index) => (
              <DraggableField key={index} field={field} />
            ))}
            </span>
          </div>
          <div className="col-md-8">
            <h4 className="fw-bolder text-center mb-3">Drop Fields Here</h4>
            <div className="border p-3 bg-white" style={{ minHeight: "400px" }}>
              {fields.map((field, index) => (
                <div key={index} className="d-flex align-items-center gap-2 p-2 bg-white">
                  <input type="text" className="form-control" value={field.label} readOnly style={{ width: "150px" }} />
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </DndProvider>
  );
};

export default function Layout({ children }) {
    const [isToggled, setIsToggled] = useState(false);

    const handleToggle = () => {
        setIsToggled(!isToggled);
        document.body.classList.toggle("sidebar-toggled");
        document.querySelector(".sidebar")?.classList.toggle("toggled");
    };

    return (
        <div>
            <div id="wrapper">
                {/* Sidebar */}
                <ul className={`navbar-nav bg-gradient-primary sidebar sidebar-dark accordion ${isToggled ? 'toggled' : ''}`} id="accordionSidebar" style={{ fontSize: '10px', overflowX: 'hidden' }}>
                    {/* Sidebar - Brand */}
                    <Link className="sidebar-brand d-flex align-items-center justify-content-center" to="/">
                        <div className="sidebar-brand-icon rotate-n-15" style={{ fontSize: '2rem' }}>
                            <img src="../img/logo.png" className="logo" alt="form logo" />
                        </div>
                        <div className="sidebar-brand-text">Form Builder</div>
                    </Link>
                    {/* Divider */}
                    <hr className="sidebar-divider my-0" />
                    {/* Nav Item - Dashboard */}
                    <li className="nav-item active">
                        <Link className="nav-link" to="/">
                            <i className="fas fa-fw fa-tachometer-alt" style={{ fontSize: '1.5rem' }} />
                            <span>Dashboard</span></Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link collapsed" to="/forms">
                            <i className="fa-regular fa-file" style={{ fontSize: '1.5rem' }}></i>
                            <span>Forms</span>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link collapsed" to="/templates">
                            <i className="fa-solid fa-chart-bar" style={{ fontSize: '1.5rem' }}></i>
                            <span>Templates</span>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link collapsed" to="/submission">
                            <i className="fa-regular fa-clipboard" style={{ fontSize: '1.5rem' }}></i>
                            <span>Submissions</span>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link collapsed" to="/login">
                            <i className="fa-solid fa-sign-out-alt" style={{ fontSize: '1.5rem' }}></i>
                            <span>Logout</span>
                        </Link>
                    </li>
                    <hr className="sidebar-divider" />
                    <div className="text-center d-none d-md-inline p-2">
                        <button className="btn btn-primary rounded-circle p-3 shadow-sm" onClick={handleToggle}>
                            <i className={isToggled ? "fas fa-angle-right text-white" : "fas fa-angle-left text-white"} style={{ fontSize: '1.5rem' }}></i>
                        </button>
                    </div>
                </ul>
                <div id="content-wrapper" className="d-flex flex-column">
                    <div id="content">
                        <nav className="navbar navbar-expand navbar-light bg-white topbar mb-4 static-top shadow">
                            <button id="sidebarToggleTop" className="btn btn-link d-md-none rounded-circle mr-3" onClick={handleToggle}>
                                <i className="fa fa-bars" style={{ fontSize: '1.5rem' }} />
                            </button>
                            <ul className="navbar-nav ml-auto">
                                <li className="nav-item dropdown no-arrow">
                                    <Link className="nav-link dropdown-toggle" to="#" id="userDropdown">
                                        <span className="mr-2 d-none d-lg-inline text-gray-600 small">John Doe</span>
                                        <img className="img-profile rounded-circle" src="img/undraw_profile.svg" alt="Profile" />
                                    </Link>
                                </li>
                            </ul>
                        </nav>
                        <div className="container-fluid">{children}</div>
                    </div>
                    <footer className="sticky-footer bg-white">
                        <div className="container my-auto">
                            <div className="copyright text-center my-auto">
                                <span>Copyright Â© Your Website 2025</span>
                            </div>
                        </div>
                    </footer>
                </div>
            </div>
        </div>
    );
}
